import { Injectable } from '@angular/core';
import {HttpClient, HttpHeaders} from "@angular/common/http";
import {User} from "../../types/User";
import {Observable} from "rxjs";

@Injectable({
  providedIn: 'root'
})
export class UsersService {

  BASE_PATH= "http://localhost:8888/api/users";
  httpOptions = {
    headers: new HttpHeaders({
      'Content-Type': 'application/json',
      'Access-Control-Allow-Origin': '*',
      'Access-Control-Allow-Methods': 'DELETE, POST, GET, OPTIONS',
      'Access-Control-Allow-Headers': 'Content-Type, Authorization, X-Requested-With'
    }),
  };
  constructor(private http: HttpClient) { }

  saveUser(user: User) {
    this.http.post<User>(this.BASE_PATH, user, this.httpOptions);
  }

  updateUser(user: User) {
    this.http.put<User>(`${this.BASE_PATH}/${user.id}`, user, this.httpOptions);
  }

  listUsers(){
    this.http.get<Array<User>>(this.BASE_PATH, this.httpOptions);
  }

  deleteUser(userId: number){
    this.http.delete(`${this.BASE_PATH}/${userId}`, this.httpOptions);
  }

}

